records.addlTxt:
Defendant Dawn M Stigler in court with Attorney Katie Beth Bricco.  Barbara A. Michaels appeared for the State of Wisconsin.  State files an amended information.  Defendant enters a no contest plea to Counts #1 & 2 on amended information.  Court performs plea colloquy and finds Defendant guilty of Count #1 & 2 on amended information.  State gives sentencing recommendations.  Attorney Bricco makes statements regarding sentencing.  Defendant makes statements.  Court sentences the Defendant to the following:

COUNT #1:  WITHHELD SENTENCE:   

TERM OF PROBATION:  2 YEARS

CONDITIONS OF PROBATON:  
____AODA Assessment and follow through with any treatment recommended;
____Absolute Sobriety;  Random U.A.'s ; 
____Domestic Violence Counseling through a State Certified Batterers Intervention Program such as Alliance Counseling or Family Services of Waukesha;
____Mental Heath / Psychological Evaluation and treatment deemed appropriate

COSTS:  $343.00 & $200.00 DNA surcharge (to be paid as a condition of probation)


COUNT #2: WITHHELD SENTENCE:   

TERM OF PROBATION:  2 YEARS

CONDITIONS OF PROBATON:  
____AODA Assessment and follow through with any treatment recommended;
____Absolute Sobriety;  Random U.A.'s ; 
____Domestic Violence Counseling through a State Certified Batterers Intervention Program such as Alliance Counseling or Family Services of Waukesha;
____Mental Heath / Psychological Evaluation and treatment deemed appropriate

COSTS:  $243.00  (to be paid as a condition of probation)
